import React from 'react';
import { Route, Router, Switch } from 'react-router';
import './App.css';

import Home from './containers/Home';

function App() {
  return (
    <div className="App">
      <header className="App-header">

      </header>
      <main>

        <Router>
        <Switch>
        <Route path="/" exact><Home /></Route>
        </Switch>
        </Router>
      </main>
    </div>
  );
}

export default App;
